import React from "react";
import { Tile } from '../tile/Tile';


export const TileList = (props) => {
  const contacts = props.contacts; 
  const appointments = props.appointments;

  return (
    <div>
      {contacts.map( (contact, index) => <Tile contact={contact} key={index}/>)}
    </div>
  );
};
